import styled from 'styled-components';

export const Landingsection = styled.div`
 marign:0;
 padding:0;
 height:710px;
 width:100%;
 background:#162082;
 position:relative;
`;

export const Image = styled.img`
position:absolute;
height:800px;
width:700px;
top:-50px;
left:0;
`;




export const Landingheader = styled.div`
display:grid;
background:#162082;
left:860px;
row-template-columns:repeat(1fr,3);
position:absolute;
top:200px;
row-gap:25px;
`;
export const Landingpageheading = styled.div`
background:green;
color:white;
font-size:2.8em;
font-weight:bold;
width:55%;
`;
